import React from 'react';
import {
  Carousel,
  Button
} from 'react-bootstrap';
import '../styles/MainBanner.css';
import dog1 from '../images/dog1'; // Update the path to your image

const MainBanner = () => {
  return (
    <div className="image-banner-container">
      <img src={dog1} alt="Descriptive Alt Text" className="banner-image" />
      <div className="buttons-container">
        <Button variant="primary">Sign Up</Button>
        <Button variant="secondary" className="ml-2">Take a Tour</Button>
      </div>
    </div>
  );
};

export default MainBanner;
